import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import {Link} from "react-router-dom";
import Particles from 'react-particles-js';
import './index.css'

export default class Homepage extends Component {
  render() {
  return (
      <div className="Homepage">
          <nav className="navbar">
            <div className="boxed">
              <i className="fa fa-user"/>
              <p>About me</p>
            </div>
            <div className="boxed">
              <i className="fa fab fa-github"/>
              <p>Portfolio!</p>
            </div>
          </nav>
        <Particles style={{width: "100%", zIndex:"0", left:0}} params={{particles: {number: {value: 50}}}}/>
          <div className="Landing">
            <h1><strong>Phoenix Jr Software Enginer!</strong></h1>
              <div className="bird-wrapper">
                <img className="bird-img" src={require('./Gang.svg')}/>
              </div>
            <h1><strong>And fulltime memer</strong></h1>
          </div>
          <div>
            <h2><strong>Your next lil bitch!</strong></h2>
          </div>
      </div>
    );
  }
}
